UnsupportedNamespace = namespace "%S" ஆதரவளிக்கப்படவில்லை.தயவுசெய்து "http://www.mozilla.org/2002/soap/security" இனைப் பயன்படுத்துக.
UnknownRootElement = root மூலகம் "%S" அறியப்பட்டிருக்கவில்லை."webScriptAccess" மூலகத்தினைத் தயவு செய்து பயன்படுத்தவும்.
UnknownElement = மூலகம் "%S" அறியப்பட்டிருக்கவில்லை.
UnknownAttribute = பண்புக்கூறு "%S" அறியப்பட்டிருக்கவில்லை.
TooManyElements = ஒன்றிற்கு மேற்பட்ட "%S" மூலகம் இருக்க முடியாது.
ElementHasSibling = "%S" மூலகம் "%S" உடன்பிறப்பினை கொண்டிருக்க முடியாது.
ElementNotEmpty ="%S" மூலகம் வெறுமையாக இருக்க வேண்டும்.
SOAPFault = SOAP { %S } %S அழைப்பு விளைவாக்கிய வழு: { %S } %S : %S.
